;; **
;;; Let us define a simple query, data and utility functions.
;; **

;; @@
(defm sample-linear-fn []
  (let [s (sample (normal 0.0 2.0))
        b (sample (normal 0.0 6.0))]
    (fn [x] (+ (* s x) b))))

(defm sample-constant-fn []
  (let [a (sample (normal 0.0 6.0))]
    (fn [x] a)))

(defm add-change-points [sample-fn lb ub]
  (if (sample (flip 0.5)) 
    (sample-fn)
    (if (sample (flip 0.5))
      (let [change-point1 (sample (uniform-continuous lb ub))
            f1 (sample-fn)
            f2 (sample-fn)]
        (fn [x] 
          (if (< x change-point1) (f1 x) (f2 x))))
      (let [change-point1 (sample (uniform-continuous lb ub))
            change-point2 (sample (uniform-continuous change-point1 ub))
            f1 (sample-fn)
            f2 (sample-fn)
            f3 (sample-fn)]
        (fn [x] 
          (if (< x change-point1) 
            (f1 x) 
            (if (< x change-point2)
              (f2 x)
              (f3 x))))))))

(defquery regression
  (let [f (add-change-points sample-constant-fn 0. 6.)]
    (observe (normal (f 0.0) 0.5) 0.6)
    (observe (normal (f 1.0) 0.5) 0.7)
    (observe (normal (f 2.0) 0.5) 1.2)
    (observe (normal (f 3.0) 0.5) 3.2)
    (observe (normal (f 4.0) 0.5) 6.8)
    (observe (normal (f 5.0) 0.5) 8.2)
    (observe (normal (f 6.0) 0.5) 8.4)
    (predict :f f)))

(def data
  [[0.0 0.6]
   [1.0 0.7]
   [2.0 1.2]
   [3.0 3.2]
   [4.0 6.8]
   [5.0 8.2]
   [6.0 8.4]])

(defn get-samples [raw-samples]
  (map #(get % :f) (map get-predicts (take 10 (take-nth 20 (drop 1000 raw-samples))))))
