;; **
;;; Now, we lazily perform the inference.
;; **

;; @@
(def raw-samples (doquery :lmh regression nil))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;linear/raw-samples</span>","value":"#'linear/raw-samples"}
;; <=

;; **
;;; And retrieve predicts from the lazy sequence.
;; **

;; @@
(def fs (get-samples raw-samples))

(defn cont [x y] x)

(def state nil)

(defn apply-f 
  [f x]
  (trampoline (f cont state x)))
