;; **
;;; And even visualize the function!
;; **

;; @@
(def xs (range 0. 6. 0.1))
(defn draw-fn [f]
  (let [ys (map (partial apply-f f) xs)
        xys (map (fn [x y] [x y]) xs ys)]
    (plot/list-plot xys :joined true :opacity 0.02 :plot-size 500 :plot-range [[0 6] [0 10]])))

(defn draw-data [] 
    (plot/list-plot data :joined false :color "black" :plot-size 500 :plot-range [[0 6] [0 10]]))

(reduce plot/compose (concat (map draw-fn fs) [(draw-data)]))
